import React from 'react';
import * as S from './VisualForm.styled';

const VisualForm = () => {
    return (
        <S.Root>
            <S.Line>
                <S.Label>Имя</S.Label>
                <S.Input />
            </S.Line>
        </S.Root>
    );
};

export default VisualForm;
